"213471":{"id":"213471","name":"O Melhor da Coreia","slug":"o-melhor-da-coreia","original_title":"코리아 넘버원","overview":"Nesta competição, celebridades visitam mestres da cultura tradicional coreana para experimentar diferentes trabalhos e tentar conquistar o título de O Melhor.","first_air_date":"2022-11-25","episode_run_time":46,"vote_average":6.3,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Jung Hyo-min"],"production_companies":[],"genres":["Reality","Comédia"],"certification":"L","backdrop_path":"https://image.tmdb.org/t/p/original/m98wgOVamULRHYKGG9o4sKcyDGS.jpg","poster_path":"https://image.tmdb.org/t/p/original/g62L2NHcTUfBuNTX3fWQx3knoIA.jpg","cast":["유재석","이광수","김연경"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/dOTXxPzpBb5KAmfEjQ3RTBo7cWD.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/dOTXxPzpBb5KAmfEjQ3RTBo7cWD.jpg","air_date":"2022-11-25","episode_count":8,"overview":"N/A","vote_average":7.6,"episodes":{"1":{"name":"Telhas Giwa em Jangheung","overview":"Yu Jae-seok, Lee Kwang-soo e Kim Yeon-koung veem como funciona o método de produção das tradicionais telhas giwa. Quem será considerado O Melhor do dia?","air_date":"2022-11-25","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/be6lW41AH32TipdlDew0XczIXpt.jpg","vote_average":8.7},"2":{"name":"Molhos Jang em Damyang","overview":"Sob um sol escaldante, o trio vai tentar fazer jang, um dos principais elementos da culinária coreana. Será que eles aguentam a pressão?","air_date":"2022-11-25","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/pNeGIfQHgHqmPbd7cTQfdcQG5w6.jpg","vote_average":8},"3":{"name":"Atoleiros no Getbol em Shinan","overview":"Na majestosa planície entremarés coreana de Sinan, os apresentadores tentam pegar polvos com as próprias mãos, lutando para não afundar na lama.","air_date":"2022-11-25","runtime":42,"still_path":"https://image.tmdb.org/t/p/original/4RKUvwjTI7sQDoAkls4K3LHwO8f.jpg","vote_average":5.5},"4":{"name":"Tecelagem Mosi em Seocheon","overview":"Kwang-soo está de olho no título de O Melhor do dia ao aprender a fazer tecido de rami de Hansan, mas essa não vai ser uma tarefa fácil!","air_date":"2022-11-25","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/35qnDHVfNiib11AK1vSL0r2RMSf.jpg","vote_average":8},"5":{"name":"Anchovas Jukbangryeom em Namhae","overview":"O trio tenta pegar anchovas usando barragens de bambu, método usado há quase 600 anos, mas precisam ser rápidos e terminar o trabalho antes que a maré suba.","air_date":"2022-11-25","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/9y6SC191ruAEVaC2ruGjnvM2w7A.jpg","vote_average":8},"6":{"name":"Tinturaria Jjock em Naju","overview":"Os apresentadores chegam a um campo de anil em Naju, onde descobrem o segredo fascinante que permite extrair pigmento azul de folhas verde índigo.","air_date":"2022-11-25","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/wOcmM6ff9U8vCmVGUItBELtjxf6.jpg","vote_average":8.5},"7":{"name":"Bebida Makgeolli em Busan","overview":"Em uma cervejaria de 500 anos em Busan, o trio aprende a fazer makgeolli do jeito tradicional, que requer ficar girando no mesmo lugar!","air_date":"2022-11-25","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/cTLcskpcKb4T42VUPA0rEP3CgIz.jpg","vote_average":5.5},"8":{"name":"Artesanato Najeonchilgi em Wonju","overview":"Na última parada, o trio começa o dia retirando seiva de árvore ao aprender sobre o complexo artesanato Najeonchilgi.","air_date":"2022-11-25","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/67ZcqP8btu5Oyq5h6CDQwV2M66E.jpg","vote_average":8.5}}}}},
